        public static UIntPtr HKEY_LOCAL_MACHINE = new UIntPtr(0x80000002u);
        public static UIntPtr HKEY_CURRENT_USER = new UIntPtr(0x80000001u);

        [StructLayout(LayoutKind.Sequential)]
        public struct SECURITY_ATTRIBUTES
        {
            public int nLength;
            public IntPtr lpSecurityDescriptor;
            public int bInheritHandle;
        }

        [Flags]
        public enum RegOption
        {
            NonVolatile = 0x0,
            Volatile = 0x1,
            CreateLink = 0x2,
            BackupRestore = 0x4,
            OpenLink = 0x8
        }

        [Flags]
        public enum RegSAM
        {
            QueryValue = 0x0001,
            SetValue = 0x0002,
            CreateSubKey = 0x0004,
            EnumerateSubKeys = 0x0008,
            Notify = 0x0010,
            CreateLink = 0x0020,
            WOW64_32Key = 0x0200,
            WOW64_64Key = 0x0100,
            WOW64_Res = 0x0300,
            Read = 0x00020019,
            Write = 0x00020006,
            Execute = 0x00020019,
            AllAccess = 0x000f003f
        }

        public enum RegResult
        {
            CreatedNewKey = 0x00000001,
            OpenedExistingKey = 0x00000002
        }

        [DllImport("advapi32.dll", SetLastError = false)]
        static extern int RegCreateKeyEx(
            UIntPtr hKey,
            string lpSubKey,
            IntPtr Reserved,
            string lpClass,
            RegOption dwOptions,
            RegSAM samDesired,
            ref SECURITY_ATTRIBUTES lpSecurityAttributes,
            out IntPtr phkResult,
            out RegResult lpdwDisposition);

        // Alternate definition - more correct
        [DllImport("advapi32.dll", SetLastError = true)]
        static extern uint RegSetValueEx(
            UIntPtr hKey,
            [MarshalAs(UnmanagedType.LPStr)] string lpValueName,
            int Reserved,
            Microsoft.Win32.RegistryValueKind dwType,
            IntPtr lpData,
            int cbData);

        [DllImport("advapi32.dll", CharSet = CharSet.Auto)]
        public static extern uint RegOpenKeyEx(
            UIntPtr hKey,
            string subKey,
            int ulOptions,
            int samDesired,
            out UIntPtr hkResult);

        [DllImport("advapi32.dll", SetLastError = true)]
        public static extern int RegCloseKey(UIntPtr hKey);

        public static bool setRegistryKeyValue(string registryPath, string valName, object value, RegistryValueKind type)
        {
            UIntPtr hKey = UIntPtr.Zero;

            try
            {
                uint retVal = RegOpenKeyEx(HKEY_LOCAL_MACHINE, registryPath, 0, 0xF003F, out hKey);
                if (retVal == 0)
                {
                    int size = 0;
                    IntPtr pData = IntPtr.Zero;
                    switch (type)
                    {
                        case RegistryValueKind.String:
                            size = ((string)value).Length + 1;
                            pData = Marshal.StringToHGlobalAnsi((string)value);
                            break;
                        case RegistryValueKind.DWord:
                            size = Marshal.SizeOf(typeof(Int32));
                            pData = Marshal.AllocHGlobal(size);
                            Marshal.WriteInt32(pData, (int)value);
                            break;
                        case RegistryValueKind.QWord:
                            size = Marshal.SizeOf(typeof(Int64));
                            pData = Marshal.AllocHGlobal(size);
                            Marshal.WriteInt64(pData, (long)value);
                            break;
                    }

                    // Set the value
                    retVal = RegSetValueEx(hKey, valName, 0, type, pData, size);

                    if (retVal != 0)
                    {
                        return false;
                    }
                }
                else
                {
                    return false;
                }
            }
            finally
            {
                if (hKey != UIntPtr.Zero)
                {
                    RegCloseKey(hKey);
                }
            }

            return true;
        }




